import { Box } from "@mui/material";

const Stays = ({ count }) => {
  return (
    <Box
      sx={{
        display: 'flex',
        fontFamily: 'Monserrate',
      }}
    >
      <h2>Stays in Finland</h2> 
      <h2 className= "StaysNumber">  {count}+ stays</h2>
    </Box>
  );
};

export default Stays;
